let defaultState = {
	fitnessClasses: []
}

export default function classReducer (state = defaultState, action) {
	console.log(action)
	switch (action.type) {
		case "ADD_CLASSES":
			return {...state, fitnessClasses: action.payload}
		default: 
		return state;
	}
}
